import React, { Component } from 'react'

export class pasada extends Component {

  constructor(props) {
    super(props);
    this.state = {
      count : 0
    };
  }

  render() {
    const {count} = this.state;
    return (
      <div>
        <button onMouseEnter={this.IncrementCount}>
          Aumenta a {count}

        </button>
      </div>
    )
  }
}

export default pasada
